      name: 'Infections'
  });
  traces.push({
      x: dates,
      y: totalDeaths,
      type: 'scatter',
      name: 'Deaths'
  });
  var layout = {
    title: {
      text: 'Accumulated Coronavirus cases in India (IN)'
    },
    yaxis: {
      title: {
        text: 'Accumulated number of cases'
      }
    }
  };
  Plotly.newPlot('graph_accu_in', traces, layout, {
      displaylogo: false,
      modeBarButtonsToRemove: ['sendDataToCloud']
  });
</script>

    </div>
  </body>
</html>
